  return (
    <>
    <div className="card">
      {pokemonItem.map((res, index) => {
        <>
          <img key={index} src={res.sprite} />
          <span key={index} className="card-title">
            {res.name}
          </span>
          <a className="btn-floating halfway-fab waves-effect waves-light red">
            <i className="material-icons">add</i>
          </a>
        </>;
      })}
    </div>
    // </>
  );
}

export { Item };
